package tr.iyte.edu.bn.stables;

public class VulSysNPTable {
	private double yes;
	private double no;
	
	public VulSysNPTable(double y, double n) {
		// TODO Auto-generated constructor stub
		yes = y;
		no = n;
	}
	public double getYes() {
		return yes;
	}
	public void setYes(double yes) {
		this.yes = yes;
	}
	public double getNo() {
		return no;
	}
	public void setNo(double no) {
		this.no = no;
	}
	

}
